import React from 'react'

import './ErrorMessage.scss'

export default class ErrorMessage extends React.Component {
    constructor(props) {
        super(props);

        this.state = {
            message: this.props.message
        }
    }

    render() {
        return (
            <>
                <div id="error-message">
                    <p>{this.state.message}</p>
                </div>
            </>
        );
    }
}
